import "../index.css"


const Text = ({selectedItem})=>{
    
    const degreeSymbol = '\u00B0';
    const gPerM3Symbol = '\u0067\u002F\u006D\u0033';
    const cubicMeterSymbol = 'm³';
    return <div className="Text">
        <div>
            <p>
                {selectedItem.DayTemp}{degreeSymbol}F / {selectedItem.NightTemp}{degreeSymbol}F
            </p>
        </div>
        <div>
            <p>
                {selectedItem.DayHumidity.toFixed(2)}({gPerM3Symbol}) / {selectedItem.NightHumidity.toFixed(2)}
            </p>
        </div>
    </div>
    
}

export default Text;
